キャッチーでかわいいモチーフと色使いが特徴のビーズ刺しゅう作家『Anne』さんデザインのキットです。<br>
ロケットモチーフもきらきらのパステルカラーでガーリーに！<br>
ふっくらと仕上げるビーズ刺しゅうのブローチは自慢したくなる完成度です。<br><br>

丁寧な作り方説明書と素材のセットです。<br><br>

◆セット内容<br>
・丸特小ビーズ1色・丸小ビーズ3色・スワロフスキービーズ・グラスカットビーズ2サイズ・フエルト2色・キルト綿・刺しゅう糸2色・ブローチピン・チャコペーパー・作り方説明書<br><br>

◆ご用意頂くもの<br>
・ビーズ針・縫い針・ハサミ・縫い糸（木綿細口30番白）・トレーサまたはボールペン・水で消えるチャコペン・刺しゅう枠（10ｃｍ）<br><br>

◆サイズ（約）：縦2.5×横4.5cm<br>
◆制作時間（分）：約4～5時間<br>
◆日本製<br><br>

※使用材料は若干変わる事があります。<br>
※小さなお子さまが誤ってパーツなどを飲みこまないようお子様の手の届かない場所に保管してください。<br>
※見本画像と現物の色が多少異なる場合がございます。<br>

