中心部分にペヨーテステッチの技法も使って立体的に仕上げます。
<br><br>
「オオルリアゲハ」モチーフ。<br>
青系グラデーションで、メタリックな色彩が特長です。<br>
カニカンとブローチ金具の両方がセットされているのでチャーム又はブローチのいずれかを選んで作ってくださいね。
<br><br>
★難易度：中級～上級<br>
★モチーフサイズ：約4.5cm×4cm（金具含まず） <br>
★用意するもの：はさみ・ものさし・プライヤー（先の細いペンチ）・先丸ペンチ
<br><br>
